import {Route, BrowserRouter as Router, Routes, Link } from 'react-router-dom'
import Agendamento from './componts/pages/agendconsul'
import Consultas from './componts/pages/consultagendadas'
import Container from './componts/layout/Container';

function App() {
  return (

       <Router>
          <ul>
                <Link to="/">Agendar Consulta</Link>
                <Link to="/consultas">Consultas Agendadas</Link>
            </ul>


            <Routes>
              <Container>
                  <Route path='/' element={<Agendamento />}/>
                  <Route path='/consultas' element={<Consultas />}/>

              </Container>

            </Routes>
        </Router>


  );
}

export default App;
